-- ----------------------------
-- Table structure for goods_brand
-- ----------------------------
DROP TABLE IF EXISTS `goods_brand`;
CREATE TABLE `goods_brand` (
  `brand_id` bigint(32) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `brand_code` varchar(64) DEFAULT NULL COMMENT '品牌编号',
  `brand_name` varchar(64) NOT NULL COMMENT '品牌名称',
  `brand_image` varchar(1024) DEFAULT NULL COMMENT '品牌图片地址',
  `letter` varchar(4) DEFAULT NULL COMMENT '品牌首字母大写',
  `describ` varchar(1024) DEFAULT NULL COMMENT '品牌简短描述',
  `data_version` bigint(32) DEFAULT '1' COMMENT '版本记录号',
  `creation_date_time` datetime DEFAULT NULL COMMENT '创建时间',
  `created_by` bigint(32) DEFAULT '-1' COMMENT '创建人',
  `last_updated_by` bigint(32) DEFAULT NULL COMMENT '最后更新人',
  `last_updated_date_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`brand_id`),
  KEY `brand_id` (`brand_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4 COMMENT='商品品牌表';

