DROP TABLE IF EXISTS `goods_category`;
CREATE TABLE `goods_category` (
  `category_id` bigint(10) unsigned NOT NULL AUTO_INCREMENT,
  `level` int(1) unsigned DEFAULT '1' COMMENT '层级',
  `parent_id` bigint(10) unsigned DEFAULT '0' COMMENT '父ID',
  `category_name_zh` varchar(128) NOT NULL COMMENT '中文',
  `category_name_ru` varchar(128) DEFAULT '' COMMENT '俄语',
  `category_name_pt` varchar(128) DEFAULT NULL COMMENT '葡萄牙语',
  `category_name_en` varchar(128) DEFAULT NULL COMMENT '英语',
  `sort` int(10) unsigned DEFAULT NULL COMMENT '排序，暂未使用',
  `query` varchar(128) DEFAULT NULL COMMENT '淘宝查询',
  `query_use` tinyint(1) unsigned DEFAULT '1' COMMENT '是否使用query',
  `weight` float unsigned DEFAULT NULL COMMENT '类目单元权重',
  `status` tinyint(1) unsigned DEFAULT '1' COMMENT '状态',
  `data_version` bigint(32) DEFAULT '1' COMMENT '版本记录号',
  `creation_date_time` datetime DEFAULT NULL COMMENT '创建时间',
  `created_by` bigint(32) DEFAULT '-1' COMMENT '创建人',
  `last_updated_by` bigint(32) DEFAULT '-1' COMMENT '最后更新人',
  `last_updated_date_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后操作时间',
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1260 DEFAULT CHARSET=utf8mb4 COMMENT='商品类目表---淘宝';

