-- ----------------------------
-- Table structure for goods_product
-- ----------------------------
DROP TABLE IF EXISTS `goods_product`;
CREATE TABLE `goods_product` (
  `product_id` bigint(32) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` bigint(32) NOT NULL COMMENT '所属用户',
  `product_code` varchar(32) DEFAULT NULL COMMENT '产品编码--暂未使用',
  `product_desc` varchar(1024) NOT NULL COMMENT '商品描述--最大允许用户输入250个汉字',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '出售价格：默认为0.00元',
  `origin_price` decimal(10,2) DEFAULT NULL COMMENT '入手价格：商品原价格，选填',
  `degree_use` varchar(32) DEFAULT NULL COMMENT '商品使用程度：全新/半新/老旧/有磨损/自定义',
  `flag` varchar(64) DEFAULT NULL COMMENT '用户定义的商品标签,相当于关键词，最多允许定义10个汉字',
  `image_url` varchar(1024) DEFAULT NULL COMMENT '商品图片地址',
  `category_id` bigint(32) DEFAULT NULL COMMENT '商品所属类目ID',
  `brand_id` bigint(20) DEFAULT NULL COMMENT '商品所属品牌ID',
  `is_able` tinyint(1) DEFAULT '1',
  `category_name` varchar(64) DEFAULT NULL COMMENT '商品分类名称',
  `brand_name` varchar(64) DEFAULT NULL COMMENT '品牌分类名称',
  `school_name` varchar(64) DEFAULT NULL COMMENT '所属学校名称',
  `contact_phone` varchar(20) DEFAULT NULL COMMENT '联系人电话',
  `contact_qq_or_wx` varchar(32) DEFAULT NULL COMMENT '联系人QQ或者微信',
  `recommend_status` int(11) DEFAULT NULL COMMENT '推荐状态',
  `data_version` bigint(32) DEFAULT '1' COMMENT '记录版本号',
  `creation_date_time` datetime DEFAULT NULL COMMENT '创建时间',
  `created_by` bigint(32) DEFAULT '-1' COMMENT '创建人',
  `last_updated_by` bigint(32) DEFAULT '-1' COMMENT '最后更新人',
  `last_updated_date_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4 COMMENT='二手商品表';

