  `school_name` varchar(128) NOT NULL,
  `account_expired_time` datetime DEFAULT NULL COMMENT '账户过期时间',
  `account_locked_time` datetime DEFAULT NULL COMMENT '帐号锁定时间',
  `credentials_expired_time` datetime DEFAULT NULL COMMENT '凭证过期时间',
  `is_admin` tinyint(4) DEFAULT '0' COMMENT '是否是管理员',
  `is_able` tinyint(4) DEFAULT '1' COMMENT '是否启用',
  `user_type` varchar(32) DEFAULT 'WEB' COMMENT '用户类型',
  `we_chat_user_id` varchar(64) DEFAULT NULL COMMENT '微信用户识别id',
  `ali_pay_user_id` varchar(64) DEFAULT NULL COMMENT '支付宝用户识别id',
  `data_version` bigint(32) DEFAULT '1' COMMENT '版本记录号',
  `creation_date_time` datetime DEFAULT NULL COMMENT '创建时间',
  `created_by` bigint(32) DEFAULT '-1' COMMENT '创建人',
  `last_updated_by` bigint(32) DEFAULT '-1' COMMENT '最后更新人',
  `last_updated_date_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `user_id` (`user_id`) USING BTREE,
  UNIQUE KEY `username` (`username`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4 COMMENT='用户';

